import React from "react";


export const Meme2 = (props) => {
  return (
    <>
      <h4>Here is the meme you generated</h4>
      <img
        style={{ width: 200 }}
        src={props.url}
        alt="No Image"
      />
    </>
  )
}
export default Meme2;
